int mapToTypeNumber(char c)
{
	if ( c == 'A' ) return 2;	//ALA
	if ( c == 'R' ) return 12;	//ARG
	if ( c == 'N' ) return 18;	//ASN
	if ( c == 'D' ) return 9;	//ASP
	if ( c == 'C' ) return 17;	//CYS
	if ( c == 'Q' ) return 19;	//GLN
	if ( c == 'E' ) return 10;	//GLU
	if ( c == 'G' ) return 1;	//GLY
	if ( c == 'H' ) return 16;	//HIS
	if ( c == 'I' ) return 7;	//ILE
	if ( c == 'L' ) return 8;	//LEU
	if ( c == 'K' ) return 11;	//LYS
	if ( c == 'M' ) return 6;	//MET
	if ( c == 'F' ) return 4;	//PHE
	if ( c == 'P' ) return 5;	//PRO
	if ( c == 'S' ) return 13;	//SER
	if ( c == 'T' ) return 14;	//THR
	if ( c == 'W' ) return 20;	//TRP
	if ( c == 'Y' ) return 15;	//TYR
	if ( c == 'V' ) return 3;	//VAL

	cout<<"======== in energyfunction:: mapToTypeNumber(char) ==================="<<endl;
	cout<<"Unknown chr1 ("<<c<<") has sent ..0 will be returned..which might cause an error"<<endl;
	cout<<"======================================================================"<<endl;
	putchar(BEEP);
	if (SHOW_ERRORS)
	{
		cout<<"Press any key..."<<endl;
		getchar();
	}		
		return 0; //Otherwise
}

void linear_int(double xa[], double ya[], int n, double x, double *y)
{
        int i=0;
        for (i=1;i<n;i++)
        {
                if(x==xa[i])
                {
                        *y=ya[i];
                        return;
                }
                if(x==xa[i+1])
                {
                        *y=ya[i+1];
                        return;
                }

                if(x>xa[i]&&x<xa[i+1])
                {
                        *y=ya[i]+(ya[i+1]-ya[i])*(x-xa[i])/(xa[i+1]-xa[i]);
                        return;
                }
        }
}



double ComputeContactEnergy_MultiPeakGaussian(int A1,int A2,double R12,FILE *ft_fun)
{
	int i=0;
	double p=5.0,q=4.0,sign=((Eij_CONTACT[A1][A2]) >= 0.0 ? 1 : -1);
	//double r0=R0_CONTACT[A1][A2];
	int idx=(A1-1)*STANDARD_AMINO_ACIDS+A2;
	double r0=CONTACT_SIDECHAIN_DISTANCE_DISTRIBUTION[idx][0][1];
//	double r1=R1_CONTACT[A1][A2]; 
	double p1=q*pow(r0/R12,p),p2=sign*p*pow(r0/R12,q);
	double E_Contact0=Eij_CONTACT [A1][A2]*(p1+p2)/(q+sign*p);
	double E_Contact1=0;
	int Is_E_Contact1_set=0;
	//new contact energy function, by weitao sun 2008.02.07
 //	int npeak=CONTACT_ENERGY_WELLS[idx][0][0];
	int npeak=int(CONTACT_SIDECHAIN_DISTANCE_DISTRIBUTION[idx][0][0]);
	if(npeak<=0) return E_Contact0;		//no peak information, just calculate as Lennard-Jones function.
	
	////////////////////////////////////////////////////////////////////
	//	1. First, determine multi-peak Gaussian function
	///////////////////////////////////////////////////////////////////
	//compute Gaussian function range.
	double FWHM=2;//3.715;	//parameter contoling Gaussian function width; more wider;
	double dr=0.2;//a small distance matching function support;
	//double dr=0.2;//a small distance matching function support;
//	double rl=CONTACT_ENERGY_WELLS[idx][1][0]-dr;
//	double rh=CONTACT_ENERGY_WELLS[idx][npeak][0]+dr;

	double rl=CONTACT_SIDECHAIN_DISTANCE_DISTRIBUTION[idx][1][0]-dr;
	double rh=CONTACT_SIDECHAIN_DISTANCE_DISTRIBUTION[idx][npeak][0]+dr;
	
	//compute parameter r0 of Lennard-Jones function to connect Gaussian function at zero energy cross section.
	//re-claculate Lennard-Jones function;
	r0=(rl )*pow( q/(double)p , -1.0/(p-q));
	p1=q*pow(r0/R12,p);
	p2=sign*p*pow(r0/R12,q);
	E_Contact0=Eij_CONTACT [A1][A2]*(p1+p2)/(q+sign*p);

	//constructing multi-peak Gaussian function:
	double peak_r[100],peak_height[100],peak_c[100],E_Contact=0;
	if(npeak>=100) return -HUGE_VAL;

	peak_r[0]=rl;	peak_r[npeak+1]=rh;
	peak_height[0]=0;	
	peak_height[npeak+1]=0;
	
	for (i=1;i<=npeak;i++)
	{
	//	peak_r[i]=CONTACT_ENERGY_WELLS[idx][i][0];
	//	peak_height[i]=CONTACT_ENERGY_WELLS[idx][i][1]*Eij_CONTACT[A1][A2];
		peak_r[i]=CONTACT_SIDECHAIN_DISTANCE_DISTRIBUTION[idx][i][0];
		peak_height[i]=CONTACT_SIDECHAIN_DISTANCE_DISTRIBUTION[idx][i][1]*Eij_CONTACT[A1][A2];
	
	}

	//////////////////////////////////////////////////////////////////////////////////////////////////
	//	Sun Weitao Added: 2008.04.24; For fast energy evaluation;
	//	if there are neighbor peaks at both sides of current R12 within sufficient small distance,
	//	then use linear interplation of peak values near R12. This sufficient small distance is
	//	the space resolution in determining distribution peaks. Here is half of dr_peak=0.2;	
	//////////////////////////////////////////////////////////////////////////
	if(R12<rl||R12>rh) 
	{
		
		E_Contact1=0;	//current distance is out of the range of multipeaks, use Lennard-jones shaped function;
		Is_E_Contact1_set=1;
	}

	if(Is_E_Contact1_set==0)
	{
		double dr_peak=0.2;	//spactial interval between peaks;
		for (i=1;i<npeak;i++)
		{
			if (fabs(peak_r[i]-R12)<dr_peak/2.0||
				fabs(peak_r[i+1]-R12)<dr_peak/2.0)
			{
				E_Contact1=peak_height[i]+(peak_height[i+1]-peak_height[i])*(R12-peak_r[i])/(peak_r[i+1]-peak_r[i]);
				Is_E_Contact1_set=1;
				break;
				//return y;
			}
		}
	}
	//////////////////////////////////////////////////////////////////////////
	//			Added end Here;
	//////////////////////////////////////////////////////////////////////////
	if(Is_E_Contact1_set==0)	
	{
		//determine width of Gaussian function;
		if(npeak<2)
		{
			peak_c[1]= (rh-rl);
		}
		else
		{
			peak_c[1]=DMAX( (rh-rl),peak_r[2]-peak_r[1])/FWHM;	
			peak_c[npeak]=DMAX( (rh-rl),peak_r[npeak]-peak_r[npeak-1])/FWHM;
			for (i=2;i<npeak;i++)
			{
				peak_c[i]= DMAX( (rh-rl),DMIN( (peak_r[i]-peak_r[i-1])/FWHM, (peak_r[i+1]-peak_r[i])/FWHM ));
			}
		}
		 
		//determine interplated peak heights;
		double Eij_r=0,dEij_r=0;
		if(R12<=rl||R12>=rh) Eij_r=0;
		else if(R12>rl&&R12<peak_r[1])
		{
			Eij_r=peak_height[1]*(R12-rl)/(peak_r[1]-rl);
		}
		else if(R12>peak_r[npeak]&&R12<rh)
		{
			Eij_r=peak_height[npeak]*(rh-R12)/(rh-peak_r[npeak]);
		}
		else
	 		linear_int(peak_r-1,peak_height-1,npeak+2,R12,&Eij_r );	//interplation of milti-peak Gaussian function;

		//compute power index of multi peak Gaussian function;
		
		if(Eij_r==0)
			E_Contact1=0;
		else		
		{
	 		double pow_idx=1;
			for (i=1;i<=npeak;i++)
			{
				double pi=(R12-peak_r[i])/(2.0*peak_c[i]);
				pow_idx*=pi*pi;
			}
	 		if(pow_idx>0)
				pow_idx*=-1;
			E_Contact1=Eij_r*exp(pow_idx);
		}
		Is_E_Contact1_set=1;
	}
	
	////////////////////////////////////////////////////////////////////
	//	2. Then determine windowed functions
	///////////////////////////////////////////////////////////////////
	double pow_idx_window=1, dr_sample=0.2,c= 0.5*(rh-rl)/FWHM;//(dr,rh-rl-2*dr)/3.715;
	int k=0,n_sample=int((peak_r[npeak]-peak_r[1])/dr_sample+0.5)-1;
	double ri=0;
	
	if(peak_r[1]+dr_sample>=peak_r[npeak-1])
		pow_idx_window*=(R12-peak_r[1])*(R12-peak_r[1])/(2*c*c);

	//for (ri=peak_r[1];ri+dr_sample<peak_r[npeak];ri+=dr_sample)
	for (ri=peak_r[1];ri+0.5*dr_sample<peak_r[npeak];ri+=dr_sample)
	{
 		//ri=peak_r[1]+dr_sample*k;		 
		pow_idx_window*=(R12-ri)*(R12-ri)/(2*c*c);
	}

	if(pow_idx_window>0)
		pow_idx_window*=-1;

	double fw1=exp(pow_idx_window);
	double fw0=1.0-fw1;

	E_Contact=E_Contact0*fw0+E_Contact1*fw1;

	if(ft_fun!=NULL)
	{
		fprintf(ft_fun,"%4.1lf\t%lf\t%lf\t%lf\t%lf\t%lf\n",
			R12,E_Contact0,E_Contact1,fw0,fw1,E_Contact);
	}
	//new contact energy function, by weitao sun 2008.01.31
//	if(r1<r0) SWT_SWAP(r0,r1);
//	double a=1,lamda=Eij_CONTACT_R1[A1][A2],d=R12-r1;
//	double E_Contact1=lamda*Eij_CONTACT [A1][A2]*exp(-a*d*d);
//	double c= (r1-r0)*0.33;
//	double f1=exp(-d*d/(2*c*c));
//	double f0=1-f1;
//	double E_Contact=E_Contact0*f0+E_Contact1*f1;
	
	//	printf("p=%lf\tq=%lf\tr0=%lf\tr12=%lf\tsign=%lf\tEij=%lf\tp1=%lf\tterm1=%lf\tp2=%lf\tterm2=%lf\tE=%lf\n",
	//	p,q,r0,R12,sign,Eij_CONTACT[A1][A2],p1,term1,p2,term2,E_Contact);
	return  E_Contact;
}


double getGyration(string AAname)
{

	if (AAname == "GLY") return 0.0;
	if (AAname == "ALA") return 0.77;
	if (AAname == "VAL") return 1.85;
	if (AAname == "PHE") return 2.39;
	if (AAname == "PRO") return 1.82;
	if (AAname == "MET") return 2.32;
	if (AAname == "ILE") return 2.12;
	if (AAname == "LEU") return 2.01;
	if (AAname == "ASP") return 1.82;
	if (AAname == "GLU") return 2.13;
	if (AAname == "LYS") return 2.45;
	if (AAname == "ARG") return 2.72;
	if (AAname == "SER") return 1.42;
	if (AAname == "THR") return 1.77;
	if (AAname == "TYR") return 2.58;
	if (AAname == "HIS") return 2.16;
	if (AAname == "CYS") return 1.81;
	if (AAname == "ASN") return 1.84;
	if (AAname == "GLN") return 2.15;
	if (AAname == "TRP") return 2.73;

	cout<<"============ in energyfunction:: getGyration(string) ================="<<endl;
	cout<<"Unknown AA name ("<<AAname<<") has sent ....which might cause an error"<<endl;
	cout<<"======================================================================"<<endl;
	putchar(BEEP);
	if (SHOW_ERRORS)
	{
		cout<<"Press any key..."<<endl;
		getchar();
	}	
	return 9999999.0;
}

//Calculate the energy within same portion (hlx for example)
//takes the portion of protein u want to get the energy for
long double intraEnergy(Protein portion,int & nAA){

	long double intra=0;

	double rg1 = 0.0,
			rg2 = 0.0;

	double intraThreshold = 4; // the threshold of distance b/w the surface of any 2 amino acids side chains

	nAA = 0;

	int numOfAA = portion.numOfAA();



	// portion.aasize() returns the number of amino acids in the portion
	for (int i=0;i<numOfAA-1;i++)
	{
		rg1 = getGyration(portion.AAs[i].chr3);

		//check if there is a need to calculate the mass center of the side chain
		if (portion.AAs [i].whtInCoord != 'S')
			portion.setSCCenter (i);

		for (int j=i+1;j<numOfAA;j++)
		{
			//check if there is a need to calculate the mass center of the side chain
			if (portion.AAs [j].whtInCoord != 'S')
				portion.setSCCenter (j);

			//computes the distance b/w the mass center of the two amino acids
			double sideChainDistance = getDistance(portion.AAs [i].coord,portion.AAs [j].coord);

			//check if the distance satisfies the threshold	
			rg2 = getGyration(portion.AAs [j].chr3);

			if ((sideChainDistance<=8.0) && (sideChainDistance - ( rg1 + rg2) <= intraThreshold))
			{
				nAA++;
				intra += ComputeContactEnergy_MultiPeakGaussian(mapToTypeNumber(portion.AAs [i].chr1),mapToTypeNumber(portion.AAs[j].chr1),sideChainDistance,NULL);
			}
		}

	}



	return intra;
}

//Calculate the energy within different portions
//it takes these portions from a vector of pdb files.... 
//portionVect represents a vector contains all portions we want to calculate the energy between
long double interEnergy(vector<Protein> portionVect){
	long double inter=0;

	double interThreshold = 4;  //The threshold

	
	double rg1 = 0.0,		//radius of gyration 1
			rg2 = 0.0;		//radius of gyration 2

	int nAA = 0,  //The number of amino acids were included in calculating energy
		numOfPortions = portionVect.size(),
		i,
		j,
		k,
		m;


	//set the mass center for all AA's in the portions
	for (i=0;i<numOfPortions;i++)
		for (j=0; j<portionVect[i].numOfAA(); j++)
			if (portionVect[i].AAs[j].whtInCoord != 'S')		//if is not already set
				portionVect[i].setSCCenter (j);


	//this loop to consider each portion
	for (i=0;i<numOfPortions -1 ;i++)
	{
		//this loop to go over each other portion 
		for (j=i+1;j<numOfPortions;j++)
		{
			//this loop to go over each amino acid from the first portion
			for (k=0;k<portionVect[i].numOfAA();k++)
			{
				rg1 = getGyration(portionVect[i].AAs[k].chr3);
				//this loop to go over each amino acid from the second portion
				for (m=0;m<portionVect[j].numOfAA();m++)
				{
					//calculates the distance between the two mass centers of the 2 amino acids
					double sideChainDistance = getDistance(portionVect[i].AAs[k].coord,portionVect[j].AAs[m].coord);
	
					rg2 = getGyration(portionVect[j].AAs[m].chr3);

					if ((sideChainDistance <= 8.0) && (sideChainDistance - (rg1 + rg2) <= interThreshold))
					{
						nAA ++;
					//	cout<<portionVect[i].aa_vect[k].chr3<<" "<<portionVect[i].aa_vect[k].num<<" Rj= "<<rg1<<"  with "<<portionVect[j].aa_vect[m].chr3<<" "<<portionVect[j].aa_vect[m].num<<" Rj = "<<rg2<<" dist= "<<sidechaindistance<<" Eij = ";
					//	cout<<ComputeContactEnergy_MultiPeakGaussian(maptotypenumber(portionVect[i].aa_vect[k].chr1),maptotypenumber(portionVect[j].aa_vect[m].chr1),sidechaindistance,NULL)<<endl;
						inter += ComputeContactEnergy_MultiPeakGaussian(mapToTypeNumber(portionVect[i].AAs[k].chr1),mapToTypeNumber(portionVect[j].AAs [m].chr1),sideChainDistance,NULL);
					}
				}
			}
		//	int mm;
		//	cin>>mm;

		}
	}


	if (nAA == 0)
		return 0.0;

	inter = inter / nAA;

	return inter;
}
